import { StatusBar } from 'expo-status-bar';
import { StyleSheet, Text, View } from 'react-native';
import { useFonts } from 'expo-font';

export default props => {
  let [fontsLoaded] = useFonts({
    'PermanentMarker': require('frontend\assets\Fonts\PermanentMarker-Regular.ttf'),
  });

  if (!fontsLoaded) {
    return <AppLoading />;
  }

  return (
    <View style={styles.container}>
      <Text style={styles.boxOne}>Umfrage</Text>
      <Text style={styles.boxTwo}>Spiele</Text>
      <Text style={styles.boxThree}>Chat</Text>
      <StatusBar style="auto" />
    </View>
  );
}

const styles = StyleSheet.create({
  container: {
    flex: 1,
    backgroundColor: '#EBEFF0',
    paddingBottom: 40,
    paddingTop: 60,
    paddingLeft: 20,
    paddingRight: 20,
    fontFamily: 'PermanentMarker'
  },
  boxOne: {
    flex: 1,
    backgroundColor: '#8BC1E9',
    margin: 30,
    textAlign: 'center',
    textAlignVertical: 'center',
    borderRadius: 25,
  },
  boxTwo: {
    flex: 1,
    backgroundColor: '#B28BBC',
    margin: 30,
    textAlign: 'center',
    textAlignVertical: 'center',
    borderRadius: 25,
  },
  boxThree: {
    flex: 1,
    backgroundColor: '#4B6E74',
    margin: 30,
    textAlign: 'center',
    textAlignVertical: 'center',
    borderRadius: 25,
  }
});
